                AND pr_requests.`trans_status` IN (1, 2)) AS A 
              INNER JOIN pr_request_items 
                ON A.id = pr_request_items.`pr_id`) AS B 
          GROUP BY B.id) AS PR 
          ON (
            RO.dep_id = PR.dep_id 
            OR RO.dep_id = 0
          ) 
          AND (
            RO.role_min_amount <= PR.request_amount
          ) 
          AND RO.role_id NOT IN 
          (SELECT 
            pr_approve_requests.`role_id` 
          FROM
            `pr_approve_requests` 
          WHERE `pr_approve_requests`.`pr_id` = PR.id 
            AND `pr_approve_requests`.`role_id` = RO.role_id 
            AND `pr_approve_requests`.`reject` = 0)) AS T1 
      INNER JOIN 
        (SELECT 
          C.id,
          MIN(C.role_max_amount) AS role_max_amount_step 
        FROM
          (SELECT 
            PR.id,
            RO.role_max_amount 
          FROM
            (SELECT 
              (
                CASE
                  WHEN TOP.max_amount > 0 
                  THEN TOP.id 
                  ELSE DEP.id 
                END
              ) AS `role_id`,
              (
                CASE
                  WHEN TOP.min_amount = 0 
                  THEN DEP.min_amount 
                  ELSE TOP.min_amount 
                END
              ) AS `role_min_amount`,
              (
                CASE
                  WHEN TOP.max_amount = 0 
                  THEN DEP.max_amount 
                  ELSE TOP.max_amount 
                END
              ) AS `role_max_amount`,
              TOP.dep_id 
            FROM
              (SELECT 
                `pr_roles`.`id`,
                pr_roles.`min_amount`,
                pr_roles.`max_amount`,
                pr_roles.`dep_id` 
              FROM
                `pr_roles` 
              WHERE pr_roles.`zone` = 1 
                AND pr_roles.`level` = 1) AS TOP 
              LEFT JOIN 
                (SELECT 
                  `pr_roles`.`id`,
                  pr_roles.`min_amount`,
                  pr_roles.`max_amount`,
                  pr_roles.`dep_id` 
                FROM
                  `pr_roles` 
                WHERE pr_roles.`zone` = 1 
                  AND pr_roles.`level` = 2) AS DEP 
                ON TOP.id = DEP.dep_id) AS RO 
            INNER JOIN 
              (SELECT 
                B.id,
                B.dep_id,
                SUM(B.amount) AS request_amount 
              FROM
                (SELECT 
                  A.*,
                  (
                    pr_request_items.`qty` * pr_request_items.`price`
                  ) AS amount 
                FROM
                  (SELECT 
                    pr_requests.`id`,
                    pr_requests.`dep_id` 
                  FROM
                    pr_requests 
                  WHERE pr_requests.`pro_id` = ProjectID 
                    AND pr_requests.`trans_status` IN (1, 2)) AS A 
                  INNER JOIN pr_request_items 
                    ON A.id = pr_request_items.`pr_id`) AS B 
              GROUP BY B.id) AS PR 
              ON (
                RO.dep_id = PR.dep_id 
                OR RO.dep_id = 0
              ) 
              AND (
                RO.role_min_amount <= PR.request_amount
              ) 
              AND RO.role_id NOT IN 
              (SELECT 
                pr_approve_requests.`role_id` 
              FROM
                `pr_approve_requests` 
              WHERE `pr_approve_requests`.`pr_id` = PR.id 
                AND `pr_approve_requests`.`role_id` = RO.role_id 
                AND `pr_approve_requests`.`reject` = 0)) AS C 
        GROUP BY C.id) AS T2 
        ON T1.id = T2.id 
        AND T1.role_max_amount = T2.role_max_amount_step) AS G 
  WHERE AuthID IN (OWNER_USER, ADMIN) 
    OR AuthID IN 
    (SELECT 
      `pr_user_assign_roles`.`user_id` 
    FROM
      `pr_user_assign_roles` 
    WHERE `pr_user_assign_roles`.`role_id` = G.role_id)) ;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `stock_balance` (IN `pro_` INT, IN `warehouse_` VARCHAR(100), IN `start_` VARCHAR(100), IN `end_` VARCHAR(100), IN `group_` INT, IN `is_zero` INT)  BEGIN
  IF group_ = 0 
  THEN IF is_zero = 0 
  THEN 
  (SELECT 
    C.id,
    C.ref_no,
    C.ref_type,
    C.item_id,
    (SELECT 
      `pr_items`.`code` 
    FROM
      `pr_items` 
    WHERE `pr_items`.`id` = C.item_id) AS item_code,
    (SELECT 
      `pr_items`.`name` 
    FROM
      pr_items 
    WHERE `pr_items`.`id` = C.item_id) AS item_name,
    C.cat_id,
    (SELECT 
      `pr_system_datas`.`name` 
    FROM
      `pr_system_datas` 
    WHERE `pr_system_datas`.`id` = C.cat_id) AS category,
    (SELECT 
      `pr_system_datas`.`desc` 
    FROM
      `pr_system_datas` 
    WHERE `pr_system_datas`.`id` = C.cat_id) AS category_desc,
    SUM(C.qty) AS qty,
    C.unit_stock,
    C.unit,
    C.warehouse_id,
    (SELECT 
      `pr_warehouses`.`name` 
    FROM
      `pr_warehouses` 
    WHERE `pr_warehouses`.`id` = C.warehouse_id) AS warehouse,
    C.trans_date,
    C.date_compare 
  FROM
    (SELECT 
      B.id,
      B.ref_no,
      B.ref_type,
      B.item_id,
      B.cat_id,
      B.unit_stock,
      B.unit,
      (B.qty * B.factor) AS qty,
      B.warehouse_id,
      B.trans_date,
      B.date_compare 
    FROM
      (SELECT 
        A.*,
        (SELECT 
          `pr_units`.`factor` 
        FROM
          `pr_units` 
        WHERE `pr_units`.`from_code` = A.unit 
          AND `pr_units`.`to_code` = A.unit_stock) AS factor 
      FROM
        (SELECT 
          st.`id`,
          st.`ref_no`,
          st.`ref_type`,
          st.`item_id`,
          (SELECT 
            `pr_items`.`cat_id` 
          FROM
            `pr_items` 
          WHERE `pr_items`.`id` = st.item_id) AS cat_id,
          (SELECT 
            `pr_items`.`unit_stock` 
          FROM
            `pr_items` 
          WHERE `pr_items`.`id` = st.`item_id`) AS unit_stock,
          st.qty,
          st.`unit`,
          st.`warehouse_id`,
          st.`trans_date`,
          (
            CASE
              WHEN st.trans_date > 
              (SELECT 
                DATE_SUB(start_, INTERVAL 1 DAY)) 
              THEN st.trans_date 
              ELSE 
              (SELECT 
                DATE_SUB(start_, INTERVAL 1 DAY)) 
            END
          ) AS date_compare 
        FROM
          `pr_stocks` AS st 
        WHERE st.`pro_id` = pro_ 
          AND st.warehouse_id IN (warehouse_) 
          AND st.`trans_date` <= end_ 
          AND st.`delete` = 0) AS A) AS B) AS C 
  GROUP BY C.warehouse_id,
    C.item_id,
    C.id) ;
  ELSE 
  (SELECT * FROM(SELECT 
    C.id,
    C.ref_no,
    C.ref_type,
    C.item_id,
    (SELECT 
      `pr_items`.`code` 
    FROM
      `pr_items` 
    WHERE `pr_items`.`id` = C.item_id) AS item_code,
    (SELECT 
      `pr_items`.`name` 
    FROM
      pr_items 
    WHERE `pr_items`.`id` = C.item_id) AS item_name,
    C.cat_id,
    (SELECT 
      `pr_system_datas`.`name` 
    FROM
      `pr_system_datas` 
    WHERE `pr_system_datas`.`id` = C.cat_id) AS category,
    (SELECT 
      `pr_system_datas`.`desc` 
    FROM
      `pr_system_datas` 
    WHERE `pr_system_datas`.`id` = C.cat_id) AS category_desc,
    SUM(C.qty) AS qty,
    C.unit_stock,
    C.unit,
    C.warehouse_id,
    (SELECT 
      `pr_warehouses`.`name` 
    FROM
      `pr_warehouses` 
    WHERE `pr_warehouses`.`id` = C.warehouse_id) AS warehouse,
    C.trans_date,
    C.date_compare 
  FROM
    (SELECT 
      B.id,
      B.ref_no,
      B.ref_type,
      B.item_id,
      B.cat_id,
      B.unit_stock,
      B.unit,
      (B.qty * B.factor) AS qty,
      B.warehouse_id,
      B.trans_date,
      B.date_compare 
    FROM
      (SELECT 
        A.*,
        (SELECT 
          `pr_units`.`factor` 
        FROM
          `pr_units` 
        WHERE `pr_units`.`from_code` = A.unit 
          AND `pr_units`.`to_code` = A.unit_stock) AS factor 
      FROM
        (SELECT 
          st.`id`,
          st.`ref_no`,
          st.`ref_type`,
          st.`item_id`,
          (SELECT 
            `pr_items`.`cat_id` 
          FROM
            `pr_items` 
          WHERE `pr_items`.`id` = st.item_id) AS cat_id,
          (SELECT 
            `pr_items`.`unit_stock` 
          FROM
            `pr_items` 
          WHERE `pr_items`.`id` = st.`item_id`) AS unit_stock,
          st.qty,
          st.`unit`,
          st.`warehouse_id`,
          st.`trans_date`,
          (
            CASE
              WHEN st.trans_date > 
              (SELECT 
                DATE_SUB(start_, INTERVAL 1 DAY)) 
              THEN st.trans_date 
              ELSE 
              (SELECT 
                DATE_SUB(start_, INTERVAL 1 DAY)) 
            END
          ) AS date_compare 
        FROM
          `pr_stocks` AS st 
        WHERE st.`pro_id` = pro_ 
          AND st.warehouse_id IN (warehouse_) 
          AND st.`trans_date` <= end_ 
          AND st.`delete` = 0) AS A) AS B) AS C 
